INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (1, 1000, "訓練はまだ\nここからですわ", 2, 3000, 2, "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 2, "調子が上がって\nきたなっ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (2, 5000, "クスクス、悪くない\n流れですわね", 2, 3000, 2, "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 2, "ほらほら、\nまだいけるだろ？");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 10000, "すばらしい\n記録ですわ", 2, 3000, 2, "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 3, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (4, 10000, "乗りに乗って\nいますわね", 3, 3000, 2, "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 3, "あたしたちはまだ\n止まらねえぜ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (5, 10000, "まだまだ行きます\nついてきなさい", 3, 3000, 2, "vo_minigame_1013_icon_1_005_002", "vo_minigame_1013_icon_2_005_002", 3, "見てろよ！\nマコト班の快進撃だ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (6, 10000, "エリコ班の\n本領発揮ですわ！", 3, 3000, 2, "vo_minigame_1013_icon_1_005_003", "vo_minigame_1013_icon_2_005_003", 3, "うおぉぉっ！\n絶好調だぜ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (7, 0, "ここからは\n前人未到の領域です！", 4, 3000, 2, "vo_minigame_1013_icon_1_006_001", "vo_minigame_1013_icon_2_006_001", 3, "どこまで行けるか\n楽しみだなっ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (8, 1, "厄介でしたわ…", 5, 1000, 3, "vo_minigame_1013_icon_1_007_001", "vo_minigame_1013_icon_2_007_001", 4, "まだ諦めんなよっ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (9, 1, "油断大敵です", 5, 1000, 3, "vo_minigame_1013_icon_1_007_002", "vo_minigame_1013_icon_2_007_002", 4, "冷やっとしたぜ…！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (10, 1, "忌々しいっ…", 5, 1000, 3, "vo_minigame_1013_icon_1_007_003", "vo_minigame_1013_icon_2_007_003", 4, "弱音を吐くなっ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (11, 99, "大所帯ですわね", 6, 1500, 4, "vo_minigame_1013_icon_1_008_001", "vo_minigame_1013_icon_2_008_001", 3, "マコト班集合！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (12, 99, "エリコ班へようこそ", 6, 1500, 4, "vo_minigame_1013_icon_1_008_002", "vo_minigame_1013_icon_2_008_002", 3, "連携してくぞ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (13, 0, "ナナカちゃんに\nお任せあれ", 8, 3000, 1, "vo_minigame_1013_icon_1_020_001", "vo_minigame_1013_icon_2_020_001", 6, "みんなに力を！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (14, 0, "はっはっは！\n任せろ！", 9, 3000, 1, "vo_minigame_1013_icon_1_022_001", "vo_minigame_1013_icon_2_022_001", 7, "任せてくれたまえ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (15, 0, "どんどんいくわよ", 10, 3000, 1, "vo_minigame_1013_icon_1_023_001", "vo_minigame_1013_icon_2_023_001", 8, "ほな、いきまひょか");
